import React from 'react';
import Customer from './Customers';

class CustomerList extends React.Component{
  render(props){
    return(
      <>
      <table>
      <tbody>
      <tr>
      <th>Name</th>
      <th>Phone</th>
      <th>Email</th>
      <th>Discount Level</th>
      <th>No. Visits</th>
      <th>Spend (£)</th>
      </tr>
      </tbody>
      <Customer data = {{tableData}}/>
      </table>
      </>
    );
  };
};

export default CustomerList;
